import ReactDOM from "react-dom/client";
import { BrowserRouter, Routes, Route } from "react-router-dom";

import Layout from "./pages/Layout";
import Home from "./pages/Home";
import Register from './pages/Register';
import Login from './pages/Login';

import ViewUser from "./pages/user/ViewUser";
import UpdateUser from "./pages/user/UpdateUser";
import DeleteUser from "./pages/user/DeleteUser";

import ViewMovie from './pages/movie/ViewMovie';
import CreateMovie from './pages/movie/CreateMovie';
import UpdateMovie from './pages/movie/UpdateMovie';
import DeleteMovie from './pages/movie/DeleteMovie';

import ViewTheater from './pages/theater/ViewTheater';
import CreateTheater from './pages/theater/CreateTheater';
import UpdateTheater from './pages/theater/UpdateTheater';
import DeleteTheater from './pages/theater/DeleteTheater';

import ViewTicket from './pages/ticket/ViewTicket';
import ManageTicket from './pages/ticket/ManageTicket';

import Booking from './pages/Booking';

import Cart from './pages/Cart';

import Payment from './pages/Payment';
import Reservation from './pages/Reservation'
import ReservationMore from './pages/ReservationMore'

import logo from './logo.svg';
import axios from 'axios';

import './App.css';


function App() {

  return (
    <div className="App container">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Layout />}>
            <Route index element={<Home />} />
            <Route path="register" element={<Register />} />
            <Route path="login" element={<Login />} />

            <Route path="users" element={<ViewUser />} />
            <Route path="update-user/:id" element={<UpdateUser />} />
            <Route path="delete-user/:id" element={<DeleteUser />} />

            <Route path="theaters" element={<ViewTheater />} />
            <Route path="new-theater" element={<CreateTheater />} />
            <Route path="update-theater/:id" element={<UpdateTheater />} />
            <Route path="delete-theater/:id" element={<DeleteTheater />} />

            <Route path="movies" element={<ViewMovie />} />
            <Route path="new-movie" element={<CreateMovie />} />
            <Route path="update-movie/:id" element={<UpdateMovie />} />
            <Route path="delete-movie/:id" element={<DeleteMovie />} />

            <Route path="tickets" element={<ViewTicket />} />
            <Route path="manage-tickets" element={<ManageTicket />} />

            <Route path="book-tickets" element={<Booking />} />
            <Route path="shop-cart" element={<Cart />} />
            <Route path="payment" element={<Payment />} />
            <Route path="reservations" element={<Reservation />} />
            <Route path="reservation/:paymentid" element={<ReservationMore />} />
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
